import React from 'react';
import { SocialIcon } from 'react-social-icons';
import './HomePage.css';
import Logo from './Images/edclogo.png';
import scrollToComponent from 'react-scroll-to-component';
import './HomePage.scss';
import Flip from 'react-reveal/Flip';
import Zoom from 'react-reveal/Zoom';
import Fade from 'react-reveal/Fade';
import Jump from 'react-reveal/Jump';
import './Navigation.css';
import './Navigation2.scss';
import Carousel from 'react-spring-3d-carousel';
//import uuidv4 from "uuid";
//import slides from './Carousel';




class HomePage extends React.Component{

 slides = [
    {

      content: <img src="https://picsum.photos/800/800/?random" alt="1" />
    },
    {
      content: <img src="https://picsum.photos/800/800/?random" alt="2" />
    },
    {
      key: uuidv4(),
      content: <img src="https://picsum.photos/600/800/?random" alt="3" />
    },
    {
      key: uuidv4(),
      content: <img src="https://picsum.photos/800/500/?random" alt="4" />
    },
    {
      key: uuidv4(),
      content: <img src="https://picsum.photos/800/800/?random" alt="5" />
    },
    {
      key: uuidv4(),
      content: <img src="https://picsum.photos/500/800/?random" alt="6" />
    },
    {
      key: uuidv4(),
      content: <img src="https://picsum.photos/800/600/?random" alt="7" />
    },
    {
      key: uuidv4(),
      content: <img src="https://picsum.photos/800/800/?random" alt="8" />
    }
];

    render(){
    return(

     <div class="body">   
         {/*Background Image */}
          <div className="BackgroundImage">


          {/*/Navigation starts*/}
        <nav class="navbar flex justify-between bb b--white-10">
          <a class="navbaranchor link white-70 hover-white no-underline flex items-center pa3" href="">              
          {/* inner navigation starts*/}
          <div className="Navigation2">
          <link rel="stylesheet" href="//maxcdn.bootstrapcdn.com/font-awesome/4.3.0/css/font-awesome.min.css" />

          <nav class="menu">
            <input type="checkbox" href="#" class="menu-open" name="menu-open" id="menu-open"/>
            <label class="menu-open-button" for="menu-open">
              <span class="hamburger hamburger-1"></span>
              <span class="hamburger hamburger-2"></span>
              <span class="hamburger hamburger-3"></span>
            </label>

            <a href = "javascript:void(0)" type="button" onClick={() => scrollToComponent(this.About, { offset: 0, align: 'top', duration: 1500})} class="menu-item"> <i class="fa fa-bar-chart"></i> </a>
            <a href = "javascript:void(0)" onClick={() => scrollToComponent(this.Events, { offset: 0, align: 'top', duration: 1500})} class="menu-item" > <i class="fa fa-plus"></i> </a>
            <a href = "javascript:void(0)" type="button" onClick={() => scrollToComponent(this.Mentors, { offset: 0, align: 'top', duration: 1500})} class="menu-item"> <i class="fa fa-heart"></i> </a>
            <a href = "javascript:void(0)"/*onClick={() => scrollToComponent(this.Contact, { offset: 0, align: 'top', duration: 1500})}*/   class="menu-item"> <i class="fa fa-envelope"></i> </a>        
          </nav>


          <svg xmlns="http://www.w3.org/2000/svg" version="1.1">
              <defs>
                <filter id="shadowed-goo">

